  false,\n\t\"url\": null,\n\t\"notes\": \"The Master Plan, consisting of three parts,
  is designed to accomplish sound and orderly development of Lacreek National Wildlife
  Refuge and provides for a continuing program of wildlife management. This portion
  of the plan is Part III, Wildlife Inventory Plan.  It provides a summary plan for
  wildlife inventory procedures on the refuge. Census and survey purpose, procedures,
  data summarization, survey routes, data forms and manpower costs are included in
  the plan.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
